import React from 'react';

const Recommendations = ({ data, district, studentZScore }) => {
        if (!data.length) return ( <div className = "no-results"> No recommendations found. </div>);

            return ( <div className = "recommendations">
                <h2> Recommended Degree Programs </h2> 
		<div className = "table-responsive">
                <table>
                <thead>
                <tr>
                <th> Course </th> 
		<th> University </th> 
		<th> Stream </th> 
		<th> Cutoff Z - score({ district.replace(/_/g, ' ') }) </th> 
		<th> Your Z - score </th> 
		</tr> 
		</thead> 
		<tbody> {
                    data.map((row, idx) => ( 
			<tr key = { idx }>
                        <td> { row.course } </td> 
			<td> { row.university.replace(/_/g, ' ') } </td> 
			<td> { row.stream.replace(/_/g, ' ') } </td> 
			<td> { row.zScores[district] } </td> 
			<td> { studentZScore } </td> 
			</tr>
                    ))
                } 
		</tbody> 
		</table> 
		</div> 
		</div>
            );
        };

        export default Recommendations;
